      mean: 5
      sd: 10
  circulation_percent: [0.0, 0.01, 0.01, 0.01, 0.01 ]
  length_of_stay:
    # drawn from gamma distribution?
    mean: 5
    sd: 10
  daily_EIR: [0.01,0.01,0.01,0.01,0.1]
  seasonal_EIR:
    a: [1]
    phi: [180]
    period: 360
    min_value: 0.1

# free recombination among the drug resistance loci
